    [],nt"num_tags": 0,nt"name": "afsc-race-sap-foy-effects-of-ocean-acidification-on-embryo-stages-of-tanner-crab-kodiak-island-",nt"isopen":
    false,nt"url": null,nt"notes": "To study the effects of ocean acidification
    we examined the effects of ocean acidification on the embryo stages of the economically
    important southern Tanner crab, Chionoecetes bairdi.n                Ovigerous females
    were reared in one of 3 treatments: control (ambient pH ~8.1), pH 7.8, and pH 7.5
    for 2 years. Embryos in year 1 were from oocytes developed in the field whereas
    embryos in n                year 2 were from oocytes developed under acidified conditions.
    Datasets associated with this study include Brooding Duration, Carbonate Chemistry,
    Embryo Morphology, and Embryo Stages. Embryo n                stages assessed monthly
    included detailed developmental stages from the prefuniculus formation through the
    prehatching stage. Embryo stages were not different among pH treatments. Embryo
    n                morphology included egg area, egg diameter, yolk area, yolk diameter,
    embryo area, eye area, and eye diameter. Each morphological characteristic varied
    according to pH treatment using a principal n                component analysis.",nt"owner_org":
